			<h1>Jobs</h1>
			<ul>
				<li>Job 1</li>
				<li>Job 2</li>
				<li>Job 3</li>
				<li>Job 4</li>
			</ul>
		</Layout>
	)

	Index.getInitialProps = async function(){
		const response = await fetch('http://careerstrip.com:3001/jobs')
		const jobs = await response.json()
		console.log({jobs})
	}
export default Index;
